/** @format */

import { Theme } from '@mui/material';
import { makeStyles } from '@mui/styles';

export const useFooterStyles = makeStyles((theme: Theme) => ({
	line: { marginTop: '100px' },
	container: {},
	footerName: {},
	moreInfo: {},
}));
